body {
  margin: 0;
  padding: 0;
  background-color: #0c2461;
}

#formContainer {
  width: 80%;
  margin: 0 auto;
  background-color: rgb(255, 255, 255);
  margin-top: 90px;
  box-shadow: 0px 0px 45px 0px rgba(0, 0, 0, 0.75);
  border-radius: 7.5px;
}
/* 
